# 52 %
# @param {String} s
# @param {String} t
# @return {Boolean}
def is_isomorphic(s, t)
  if s.length != t.length then return false end
  sh, th = {}, {}
  for i in 0..s.length-1 do
    if !sh.key?(s[i]) then sh[s[i]] = [i] else sh[s[i]] << i end
    if !th.key?(t[i]) then th[t[i]] = [i] else th[t[i]] << i end
  end
